import React from 'react'



function AddCard({studyDeck}){
  let result
  if(studyDeck!==undefined){
    result=(
      <>
        <h2 className={"col align-self-start"}>Not Enough Cards</h2>
        <p className={"col align-self-start"}>You need atleast 3 cards. You have {studyDeck.cards.length} cards.</p>
        <button className={"col-2 btn btn-primary"}>Add Card</button>
      </>
      )
  }
  return result;
}


export default AddCard;
